svg.script:
  document.loadKeyboard = function(layout) {
    if (!Keyboards || !(layout in Keyboards)) {
      return;
    }

    var layout = Keyboards[layout];
    for (var key in layout) {
      for (var i = 0; i < layout[key].length; ++i) {
        for (var j = 0; j < layout[key][i].length; ++j) {
          var dom = document.getElementById(key + "_" + i + "_" + j);
          if (dom) {
            dom.innerHTML = layout[key][i][j].replace(/&/g, "&amp;")
                                             .replace(/</g, "&lt;")
                                             .replace(/>/g, "&gt;")
                                             .replace(/\"/g, "&quot;")
                                             .replace(/\'/g, "&apos;");
          }
        }
      }
    }
  }

  document.highlight = function(layout, row, finger, position) {
    if (!Keyboards || !(layout in Keyboards)) {
      return;
    }

    var layout = Keyboards[layout];
    var dom;

    if (row != -1) {
      var kRow;
      switch(row) {
        case 0: kRow = layout.row0; break;
        case 1: kRow = layout.row1; break;
        case 2: kRow = layout.row2; break;
        default: return;
      }

      if (!finger in kRow) {
        return;
      }

      if (!position in kRow[finger]) {
        return;
      }

      dom = document.getElementById("row" + row + "_" + finger + "_" + position + 'b');
      if (!dom && finger < 8) {
        dom = document.getElementById("row" + row + "_" + (finger + 8) + "_" + position + 'b');
      }

      if (!dom && finger >= 8) {
        dom = document.getElementById("row" + row + "_" + (finger - 8) + "_" + position + 'b');
      }
    } else {
      dom = document.getElementById("space");
    }

    if (!dom) {
      return;
    }

    animate(dom);

    if (finger >= 8 && row != -1) {
      var s = finger < 12 ? document.getElementById('r_shift')
                          : document.getElementById('l_shift');
      animate(s);
    }
  }

  function animate(dom) {
    var R = 0x97, G = 0xc5, B = 0xd5;
    var r = 0x00, g = 0x00, b = 0x00;
    var step = 10;
    var rS = (R - r) / step;
    var gS = (G - g) / step;
    var bS = (B - b) / step;

    function update() {
      if (!step-- && id) {
        dom.setAttribute('style', 'fill:rgb(' + R + ',' + G + ',' + B + ');');
        clearInterval(id);
      } else {
        dom.setAttribute('style', 'fill:rgb(' + Math.round(r) + ',' + Math.round(g) + ',' + Math.round(b) + ');');
        r+=rS; g+=gS; b+=bS;
      }
    };

    var id = setInterval(update, 50);
    update();
  }
